import React, { useRef, useEffect } from 'react';
import '../css/UserNavbar.css';

function UserNavbar({ isOpen, toggleSidebar }) {

  const sidebarRef = useRef(null);

  return (
    <div ref={sidebarRef} className={`user-sidebar ${isOpen ? 'open' : ''}`}>
      <button className="user-sidebar-close-button" onClick={toggleSidebar}>×</button>
      <ul className="user-navbar-list">
        <li><button>계정</button></li>
        <li><button>이력서</button></li>
        <li><button>포트폴리오</button></li>
      </ul>
    </div>
  );
}

export default UserNavbar;
